/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER after_tua_sach_insert
AFTER INSERT ON tua_sach

FOR EACH ROW

BEGIN
	DECLARE total INT;
	SET total = new.Total;
    while(total>0) do
		   INSERT INTO cuon_sach(ID,SKU,mStatus,Location,ImportedDay)
           VALUES(DEFAULT,new.SKU,0,rand(5)+1,now());
           set total = total-1;
	    
	end while;

END */;;
