CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateBook`(IN mSKU VARCHAR(13),IN mBName VARCHAR(250),IN mAuthor VARCHAR(250),IN mGender VARCHAR(250),IN mPublisher VARCHAR(250),IN mPublishedDay VARCHAR(250),IN mPrice VARCHAR(250),IN mTotal VARCHAR(250))
BEGIN
  DECLARE dCount INT DEFAULT 0;
  SELECT COUNT(*) 
  INTO dCount
  FROM tua_sach
  WHERE SKU = mSKU;
  
  IF(dCount >0 ) THEN
  BEGIN
	IF(mBName = NULL) THEN 
	   SET dCount = 1;
    ELSE
		UPDATE tua_sach
        SET BName = mBName 
        WHERE SKU = mSKU;
	END IF; 
	
    IF(mAuthor != NULL) THEN
		SET dCount = 1;
	ELSE
		UPDATE tua_sach
        SET Author = mAuthor 
        WHERE SKU = mSKU;   
	END IF;
	
    IF(mGender != NULL) THEN 
		SET dCount = 1;
	ELSE
		UPDATE tua_sach
        SET Gender = mGender 
        WHERE SKU = mSKU;
	END IF;
    
    IF(mPublisher != NULL) THEN 
		SET dCount = 1;
	ELSE
		UPDATE tua_sach
        SET Publisher = mPublisher 
        WHERE SKU = mSKU;
	END IF;
    
    IF(mPublishedDay != NULL) THEN 
		SET dCount = 1;
    ELSE
		UPDATE tua_sach
        SET PublishedDay = mPublishedDay 
        WHERE SKU = mSKU;
	END IF;
    
    IF(mPrice != NULL) THEN 
		SET dCount = 1;
    ELSE
		UPDATE tua_sach
        SET Price = mPrice 
        WHERE SKU = mSKU;
    END IF;
    
    IF(mTotal != NULL) THEN 
		SET dCount = 1;
    ELSE
		UPDATE tua_sach
        SET Total = CAST(mTotal AS UNSIGNED) 
        WHERE SKU = mSKU;
    END IF;
   END;

   ELSE
	INSERT INTO tua_sach
    VALUES(mSKU,mBName,mAuthor,mGender,mPublisher,mPublishedDay,mPrice,mTotal);
   END IF;

END ;;
DELIMITER ;
